  assemblies:
  - Microsoft.Health.ItemTypes
  namespace: Microsoft.Health.ItemTypes
  summary: "\nRepresents a pressure measurement and a display value\nassociated with the measurement.\n"
  remarks: "\nIn HealthVault, pressure measurements have values and display values. \nAll values are stored in a standard SI unit of pascal (Pa). \nAn application can take a pressure value using any scale the application \nchooses and can store the user-entered value as the display value, \nbut the pressure value must be converted to pascals to be stored in HealthVault.\n"
  example: []
  syntax:
    content: 'public class PressureMeasurement : Measurement<double>'
    content.vb: >-
